import React from 'react';

const Post = ({image, name, content, price, link}) => {
  return (
    <div className="post">
      <img src={image} />
      <h2 className="name">{name}</h2>
      <div className="content">
        {content}
      </div>
      <div className="subtitle">от {price} Р</div>
      <a>Перейти</a>
    </div>
  );
};

export default Post;
